-left:0rem;margin-bottom:2rem;margin-right:0rem;"><a href="https://github.com/KittyMac/Chibley"><img style="display:flex;width:5rem;height:5rem;min-width:5rem;min-height:5rem;max-width:5rem;max-height:5rem;margin-top:0rem;margin-left:1rem;margin-bottom:1rem;margin-right:1rem;" draggable="false" src="public/icon192.png"/></a> <div style="display:flex;flex-direction:column;flex: 1 1 auto;min-height:5rem;"><div style="display:flex;font-size:2.2rem;font-family:'Roboto';color:var(--fh-fblack);">Chibley</div> <div style="display:flex;font-size:1.0rem;font-family:'Lato';color:var(--fh-fblack);">Simple API for coding practice</div></div></div> <div style="display:flex;flex-direction:column;margin-top:1rem;margin-left:1rem;margin-bottom:1rem;margin-right:1rem;"><div style="display:flex;font-size:1.2rem;font-family:'Roboto';color:var(--fh-fblack);">Simple API Calls</div> <div style="display:flex;font-size:1.2rem;font-family:'Lato';color:var(--fh-fblack);margin-top:1rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;">Calls are made to the API by sending a JSON payload in the HTTP request. A simple version of this can be achieved by using the curl command.</div> <div id="code0" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div> <div id="code1" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div> <div id="code2" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div> <div style="display:flex;height:2rem;"></div> <div style="display:flex;font-size:1.2rem;font-family:'Roboto';color:var(--fh-fblack);">Persistent Session API Calls</div> <div style="display:flex;font-size:1.2rem;font-family:'Lato';color:var(--fh-fblack);margin-top:1rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;">Chibley is a straight-forward actor/model http server. When you open a connection to the server&#x002C; an actor is created to service your requests. The actor will stay alive so long as you are interacting with it&#x002C; and will be destroyed when you've stopped interacting with it for a while. During this time server-side state can be mutated by sending the Session-Id back to the server to reference server-side actor associated with this session.</div> <div id="code3" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div> <div id="code4" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div> <div id="code5" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div> <div id="code6" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div> <div id="code7" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div> <div id="code8" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div> <div style="display:flex;font-size:1.2rem;font-family:'Lato';color:var(--fh-fblack);margin-top:1rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;">Here is a complete session example spread across multiple API calls.</div> <div id="code9" style="display:flex;border:0.1rem solid var(--fh-item-outline);margin-top:0.5rem;margin-left:0rem;margin-bottom:0.5rem;margin-right:0rem;"></div></div></div> <div id="alertsContainer" style="display:flex;left:0px;top:0px;margin:0px;padding:0px;width:100%;height:100%;position:fixed;position:absolute;background:rgba(0,0,0,0.5);justify-content:center;align-items:center;overflow:hidden;display:none;"></div> <script>
        InitFigurehead();
        
        let url = "https://www.swift-linux.com/chibley/"
        
        let code0 =
`
// Simple curl test to ensure the API is working
curl -X POST -H "Content-Type: application/json" -d '{"service":"PokemonService","command":"list"}' ${url}
`;

        let code1 =
`
// Request a list of all pokémon
{
    "service":"PokemonService",
    "command":"list"
}
`;

        let code2 =
`
// Request a subset of pokémon, supplying a JSONPath query selector
// This selector uses a regex to return only pokémon whose name 
// begins with the letter B
{
    "service":"PokemonService",
    "command":"list",
    "path":"$..[?(@.name =~ /^B/i)]"
}
`;

        let code3 =
`
// Session persistance is achieved using the Session-Id http header.
// Send a request without a Session-Id and a new session will be started on the server and
// its Session-Id will be sent to you. To send more requests to the same session, simply
// send the Session-Id back to the server in the HTTP headers
//
// Sample HTTP response
HTTP/1.1 200 OK
Set-Cookie:CB7A4CDB-38B4-4923-B1A9-6C06DE9D8921=9C12B0A1-DFE9-4C09-ADF4-FC851E62BF04; HttpOnly
Session-Id:8C6394EA-BB4A-48F5-8C52-544F6B013BD0
Service-Response:null
Last-Modified:2022-03-04 05:03:47 +0000
Connection:keep-alive
Content-Type:application/json
Content-Length:61261
...
`;

        let code4 =
`
// Capture a pokémon. The pokémon will be added to the collection of pokémon associated with this session.
{
    "service":"PokemonService",
    "command":"capture",
    "number":"#37"
}
`;

        let code5 =
`
// Release a pokémon. The pokémon will be removed from the collection associated with this session.
{
    "service":"PokemonService",
    "command":"release",
    "number":"#37"
}
`;

        let code6 =
`
// Release a pokémon. The pokémon will be removed from the collection associated with this session.
{
    "service":"PokemonService",
    "command":"release",
    "number":"#37"
}
`;

        let code7 =
`
// Evolve a pokémon. The pokémon will be changed to its next evolution (assuming that is possible)
{
    "service":"PokemonService",
    "command":"evolve",
    "number":"#37"
}
`;

        let code8 =
`
// List the pokémon in your collection
{
    "service":"PokemonService",
    "command":"inventory",
}

// List the pokémon in your collection (optional JSONPath query)
{
    "service":"PokemonService",
    "command":"inventory",
    "path":"$..[?(@.name =~ /^B/i)]"
}
`;

        let code9 =
`
// Example session flow played out using curl. Note that in the result of the first verbose
// call using curl you need to copy/paste the correct Session-Id to subsequent calls (exmaple Session-Id: 552B56E8-4DAF-466B-9611-1A9BF13A82F1)

// Grab list of all pokemon starting with the letter B. Copy/Paste the Session-Id from the results of this call and replace them in the rest
curl -v -X POST -H "Content-Type: application/json" -d '{"service":"PokemonService","command":"list","path":"$..[?(@.name =~ /^B/i)]"}' ${url}

// List the your current pokemon inventory (pokemon you have captured); should be empty array.
curl -X POST --header "Session-Id:REPLACE-THIS-SESSION-UUID" -H "Content-Type: application/json" -d '{"service":"PokemonService","command":"inventory"}' ${url}

// Capture pokemon number #001
curl -X POST --header "Session-Id:REPLACE-THIS-SESSION-UUID" -H "Content-Type: application/json" -d '{"service":"PokemonService","command":"capture","number":"#001"}' ${url}

// List the your current pokemon inventory (pokemon you have captured); should contain Bulbasaur.
curl -X POST --header "Session-Id:REPLACE-THIS-SESSION-UUID" -H "Content-Type: application/json" -d '{"service":"PokemonService","command":"inventory"}' ${url}

// Attempt to evolve a pokemon you have not yet captured (should result in bad request error)
curl -X POST --header "Session-Id:REPLACE-THIS-SESSION-UUID" -H "Content-Type: application/json" -d '{"service":"PokemonService","command":"evolve","number":"#005"}' ${url}

// Evolve your captured pokemon
curl -X POST --header "Session-Id:REPLACE-THIS-SESSION-UUID" -H "Content-Type: application/json" -d '{"service":"PokemonService","command":"evolve","number":"#001"}' ${url}

// List the your current pokemon inventory (pokemon you have captured); should contain Ivysaur.
curl -X POST --header "Session-Id:REPLACE-THIS-SESSION-UUID" -H "Content-Type: application/json" -d '{"service":"PokemonService","command":"inventory"}' ${url}
`;
        
        let codeExamples = {
            "code0": code0,
            "code1": code1,
            "code2": code2,
            "code3": code3,
            "code4": code4,
            "code5": code5,
            "code6": code6,
            "code7": code7,
            "code8": code8,
            "code9": code9
        };
        for (codeId in codeExamples) {
            cm.CreateEditor(codeId, [cm.javascriptSetup], codeExamples[codeId], false);
        }
        
    </script> </body> </html>
